import classes from "./ProductCard.module.scss";

const ProductCard = () => {
  return (
    <div className={classes.card}>
      <div>
        <img />
        <div>
          <span>dfdf</span>
          <span>dfdf</span>
          <span>dfdf</span>
        </div>
      </div>

      <h4>Hello</h4>
    </div>
  );
};

export default ProductCard;
